create table `#__rw_desc`
(
    id int auto_increment,
    stationID int not null,
    tppd boolean default 0 not null,
    time_1 time default null null,
    time_2 time default null null,
    time_mask varchar(7) default 1111111 not null,
    constraint `#__rw_desc_pk`
        primary key (id),
    constraint `#__rw_desc_#__rw_stations_id_fk`
        foreign key (stationID) references `#__rw_stations` (id)
            on update cascade on delete cascade
)
    comment 'Время работы касс';

create index `#__rw_desc_time_1_index`
    on `#__rw_desc` (time_1);

create index `#__rw_desc_time_2_index`
    on `#__rw_desc` (time_2);

create index `#__rw_desc_time_mask_index`
    on `#__rw_desc` (time_mask);

create index `#__rw_desc_tppd_index`
    on `#__rw_desc` (tppd);

